import base64
from os import getenv, path, mkdir

app_data_path = getenv('APPDATA')
path1 = f"{app_data_path}/PDF_Convertor"


def create_photos():
    if not path.exists(path1):
        mkdir(path1)

    if not path.exists(f"{path1}/html.png"):
        with open(f"{path1}/html.png", "wb") as f:
            f.write(base64.b64decode(b''
))

    if not path.exists(f"{path1}/img.png"):
        with open(f"{path1}/img.png", "wb") as f:
            f.write(base64.b64decode(b''
))

    if not path.exists(f"{path1}/txt.png"):
        with open(f"{path1}/txt.png", "wb") as f:
            f.write(base64.b64decode(b''
))

    if not path.exists(f"{path1}/word.png"):
        with open(f"{path1}/word.png", "wb") as f:
            f.write(base64.b64decode(b''
))

